import React, { Component } from 'react'

export default class dataset extends Component {
    render() {
        return (
            <div>
                <div  className="page-header">
                    <h3 className="page-title"> Dataset </h3>
                    <nav aria-label="breadcrumb">
                    <a  href=""class="btn btn-primary" title="Model Page" onClick={()=>this.props.history.push('/form-elements/modelpage')}><i className="fa fa-wrench"></i> </a> <a  href=""class="btn btn-primary" title="Train Model" onClick={()=>this.props.history.push('/form-elements/train')}><i className="fa fa-cogs"></i> </a>
                    </nav>
                    </div>

            </div>
        )
    }
}
